			function stickySetup() {
				HOME_STICKY_INDICATOR = document.querySelector('.js-fix-indicator');
				HOME_STICKY_DONE = false;
				HOME_STICKY_INDICATOR_DIST_FROM_TOP = HOME_STICKY_INDICATOR.offsetTop;
			}



			function stickyCheck() {

					if(!GLOBAL_IS_BP_S) {

						//check if the indicator has reached the top
						if(window.pageYOffset >= HOME_STICKY_INDICATOR_DIST_FROM_TOP && !HOME_STICKY_DONE) {
							HOME_STICKY_DONE = true;
							GLOBAL_BODY.classList.add('no-intro');
							GLOBAL_BODY.classList.add('sticky');
							window.scrollTo(0, 0);
						} 

					} else {

						if(window.pageYOffset >= HOME_STICKY_INDICATOR_DIST_FROM_TOP) {

							if(!HOME_STICKY_DONE) {
								HOME_STICKY_DONE = true;
								GLOBAL_BODY.classList.add('no-intro');
								window.scrollTo(0, window.innerHeight);

								HOME_STICKY_INDICATOR_DIST_FROM_TOP = window.innerHeight;
							}
							
							GLOBAL_BODY.classList.add('sticky');
							
						}  else {
							GLOBAL_BODY.classList.remove('sticky');
						}
						
					}
			}


			function initGalleries() {


				var galleryContainerList = document.querySelectorAll('.js-project-gallery');
				var elemList = document.querySelectorAll('.main-carousel');
				var elemListLength = elemList.length;


				for(var i = 0; i < elemListLength; i++) {

					function b(j){

						var elem = elemList[j];
						var galleryContainer = galleryContainerList[j];

						var flkty = new Flickity( elem, {
						  // options
						  cellAlign: 'left',
						  contain: true,
						  pageDots: false,
						  draggable: false,
						  prevNextButtons: false,
						  wrapAround: true
						  
						});

						var caption = galleryContainer.querySelector('.js-gallery-caption');
						var numbering = galleryContainer.querySelector('.js-gallery-img-nr');

						flkty.on( 'select', function() {
						  caption.innerHTML = flkty.selectedElement.dataset.caption;
						  numbering.innerHTML = flkty.selectedElement.dataset.index;
						});


						var previousButton = galleryContainer.querySelector('.button--previous');
						previousButton.addEventListener( 'click', function() {
						  flkty.previous();
						});
						
						var nextButton = galleryContainer.querySelector('.button--next');
						nextButton.addEventListener( 'click', function() {
						  flkty.next();
						});


						var hideGalleries = document.querySelector('.js-hide-galleries');

					setTimeout(function(){ 

						flkty.resize(); 
						
						hideGalleries.classList.remove('hide-galleries');
					}, 200);



					}

					b(i);



				}

				
				// var domGalleryNode = document.querySelectorAll('.myGalleryExample');
				// var galleryListLength = domGalleryNode.length;
				// var instanceGallery;

				// for(var i = 0; i < galleryListLength; i++) {
				// 	console.log('domGalleryNode ' + domGalleryNode);
				// 	instanceGallery = new LightBoxGallery(domGalleryNode[i]);
			 //    	instanceGallery.init();
				// }
			    
			}


			function checkBreakpoint() {
				if (window.innerWidth <= window.innerHeight || window.innerWidth <= 700){
					GLOBAL_IS_BP_S = true;
					document.querySelector('.cover').classList.add('show');
					document.querySelector('.cover').classList.add('message');
				} else {
					GLOBAL_IS_BP_S = false;
					document.querySelector('.cover').classList.remove('show');
				}
			}


			function checkTouchscreen() {
				window.addEventListener('touchstart', function() {
				  	GLOBAL_IS_TOUCHSCREEN = true;
				});
				
			}


			(function() {
			    var throttle = function(type, name, obj) {
			        obj = obj || window;
			        var running = false;
			        var func = function() {
			            if (running) { return; }
			            running = true;
			             requestAnimationFrame(function() {
			                obj.dispatchEvent(new CustomEvent(name));
			                running = false;
			            });
			        };
			        obj.addEventListener(type, func);
			    };

			    /* init - you can init any event */
			    throttle("resize", "optimizedResize");
			})();


			// handle event
			window.addEventListener("optimizedResize", function() {

			    setTimeout(function(){ 
					addTransitionToScrollIndicator();			
					updateScrollIndicator();
				}, 100);

				checkBreakpoint();


				if(GLOBAL_OBJECT_INTERACTION_AREA) {

					GLOBAL_OBJECT_INTERACTION_AREA_WIDTH = GLOBAL_OBJECT_INTERACTION_AREA.getBoundingClientRect().width;
					
				}

				
			});



		
	

